import KotlinPlayground from "react-kotlin-playground";

const KotlinTest = ({lastJsonMessage, handleHtmlChange}) => {

    return (
        <KotlinPlayground mode="kotlin" targetPlatform='js'>
        <pre>
          <code>
            <textarea value={lastJsonMessage?.data.editorContent || ''} onChange={handleHtmlChange} />              
          </code>
        </pre>
      </KotlinPlayground>
    )
}

export default KotlinTest;
